import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div>
      <h1>Homepage</h1>
      <Link to="/pokemons">
        <h2>GO TO POKEMONS</h2>
      </Link>
    </div>
  );
};

export default Home;
